import L from 'leaflet';
import '../../styles.css';

const iconWidth = 40;
const iconHeight = 40;

var iconDroneBase = L.Icon.extend({
    iconUrl: require('../../images/drone.png'),
    iconRetinaUrl: require('../../images/drone.png'),
    iconAnchor: null,
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: new L.Point(iconWidth, iconHeight),
});

var iconTractorBase = L.Icon.extend({
    options: {
        iconUrl: require('../../images/tractor.jpg'),
        iconRetinaUrl: require('../../images/tractor.jpg'),
        iconAnchor: [12, 41],
        popupAnchor: null,
        shadowUrl: null,
        shadowSize: [41, 41],
        shadowAnchor: null,
        iconSize: new L.Point(iconWidth, iconHeight),
    }
});

const iconTractorUnreachable = new iconTractorBase({
    className: 'leaflet-div-icon-unreachable'
});

const iconTractorIdle = new iconTractorBase({
    className: ' leaflet-div-icon leaflet-div-icon-idle'
});

const iconTractorOnMission = new iconTractorBase({
    className: 'leaflet-div-icon leaflet-div-icon-on-mission'
});

const iconDroneUnreachable = new iconTractorBase({
    className: 'leaflet-div-icon-unreachable'
});

const iconDroneIdle = new iconTractorBase({
    className: ' leaflet-div-icon leaflet-div-icon-idle'
});

const iconDroneOnMission = new iconTractorBase({
    className: 'leaflet-div-icon leaflet-div-icon-on-mission'
});

const iconDrone = new L.Icon({

    className: 'leaflet-div-icon leaflet-div-icon-idle'
});

export { iconTractorIdle, iconTractorOnMission, iconTractorUnreachable, iconDrone };
